import Tabel from "../table/Tabel";
import FormCreate from "./FormCreate";
import { useState } from "react";


const Formulir = () => {

    const [getDatas, setDatas] = useState([
        {id:1, Nama:'Antony', Email:'AnthonyJoshua@gmail.com'},
        {id:2, Nama:'John Cena', Email:'JohnCena@gmail.com'},
        {id:3, Nama:'The Rock', Email:'Roccky@gmail.com'}
    ])

    return(
    <div>
        <Tabel dataDatas={getDatas} />
    </div>
    )
}
export default Formulir;
